{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/hazemkhaledkhabir/project-bellabeat?scriptVersionId=88872390\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# **Project_Bellabeat_2022_01_26_v01**\n### Made by Hazem Khaled\n### Created: 2022/01/26\n### Last updated: 2022/02/26\n\n*****************************","metadata":{}},{"cell_type":"markdown","source":"## **Note:** This project is a capstone for Google data analytics professional certificate, and as a scenario, I'm a junior data analyst in Bellabeat.","metadata":{}},{"cell_type":"markdown","source":"**Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, co-founder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company.**","metadata":{}},{"cell_type":"markdown","source":"**I have been asked to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights I discover will then help guide marketing strategy for the company. I will present my analysis to the Bellabeat executive team along with my high-level recommendations for Bellabeat’s marketing strategy.**","metadata":{}},{"cell_type":"markdown","source":"**According to Google's approach, The data analysis process is divided into six phases, Ask, Prepare, Process, Analyze, Share, and Act. I will use this approach to analyze and solve the problem that was given to me to solve.**\n\n****************************************","metadata":{}},{"cell_type":"markdown","source":"## **ASK Phase** ","metadata":{}},{"cell_type":"markdown","source":"### **Statement of the business task:**\n#### **The business task is to:**\n\n* Understand the trends in the usage of smart devices of our customers.\n* Get insights from those trends.\n* Know how to apply these insights to our customers.\n* Use these insights and apply them to our products.\n* Understand how those trends will affect our marketing strategy.\n* Share those insights through a presentation.\n    \n","metadata":{}},{"cell_type":"markdown","source":"**I searched who my audience is? I found a lot of information, but I wanted to focus on the main characteristics and how they see things.**\n* *Urska:* A person who is into art and a healthy lifestyle.\n* *Sandro:* A person who is into business and technology.\n* *Marketing team:* a group of people who are interested in the metrics of successful marketing.\n* *Data analysts:* a group of people who are interested in the details of the analysis.\n\n**stakeholders have different interests, so my presentation must be covering all those perspectives. I should give an appropriate presentation covering the main aspects but with some details, at the same time having another version with more details for technical stakeholders.**\n\n**************************************************","metadata":{}},{"cell_type":"markdown","source":"# **Prepare Phase**","metadata":{}},{"cell_type":"markdown","source":"In this phase, I should check the source of the data.\n\n### **How it was collected? Who collected the data?**\nThe data I will work on to solve the business task was given to me by my stakeholders. It's a public dataset on Kaggle, and it contains the FitBit application usage of 30 users who agreed to let their data be used. The data was collected by Amazon Mechanical Turk through a survey. It was collected in 2016 which means it's not recent data, but at the same time it's not too old to be refused.\n\n### **Is my data representative?**\nI've checked the total user number in 2016 [here](https://www.businessofapps.com/data/fitbit-statistics/) which is **23.2 million** users, and with 30 users as a sample, I can say it can be used but the **confidence level** will be **80%** and the **margin of error** will be **11.7%**.\n\n![image.png](attachment:5cf43c3a-393c-4f98-a96c-bde5cc0da36d.png)\n\n","metadata":{},"attachments":{"5cf43c3a-393c-4f98-a96c-bde5cc0da36d.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **Where is the data? what's its type?**\n\nThe data is gathered on Kaggle in the form of 18 tables and in **CSV** format. The data is external and structured. I will consider it as third-party data. the data contains both qualitative and quantitative data.\n\n### **Is the data biased?**\n\nThe data didn't provide any details about who are the 30 users. I can't know the number of males and females, their ages, or their countries. So, there is a possibility that the data is biased. rule of thumb here is to communicate with stakeholders to discuss this problem, But that's not possible, so I will work with the data anyway. \n\n### **Checking data for ROCCC**\n\n#### **Reliable?**\nIf we ignored the bias problem, we can say that the data is accurate and the observations are complete.\n\n#### **Original?**\nI would prefer to use first-party data, but since we want to get data about customers using non-Bellabeat products, it's not an option. However, the source of our data is a trusted and popular source, so I will work with the data.\n\n#### **Comprehensive?**\nI believe this data will be enough to answer the question we want to answer through analysis.\n\n#### **Current?**\nthe data wasn't updated since it was collected, however, it’s not so old, so we can use it.\n\n#### **Cited?**\nThe metadata contains all the information about the data including **license, collectors, and dates**.\n\n**Summary:** This data ROCCC(s) and also open, so we can use, modify, and reshare it without any problems.\nThere is no **PII** information considering the privacy aspect.\n","metadata":{}},{"cell_type":"markdown","source":"### **Data I will work with:**\n* Daily_Activity (loaded, sorted, and filtered in spreadsheets)\n* Sleep_Day   (loaded, sorted, and filtered in spreadsheets)\n* Weight_Log  (loaded, sorted, and filtered in spreadsheets)\n* Heartrate_seconds  (loaded, sorted, and filtered in R) because it’s too big for spreadsheets.\n\n![image.png](attachment:74a60b7a-9f44-4a92-ba38-3db9d9da170a.png)\n\n","metadata":{},"attachments":{"74a60b7a-9f44-4a92-ba38-3db9d9da170a.png":{"image/png":""}}},{"cell_type":"code","source":"#loading the packages to import and clean data in R studio.\n\nlibrary(\"tidyverse\")\nlibrary(\"here\")\nlibrary(\"skimr\")\nlibrary(\"janitor\")\nlibrary(\"dplyr\")\nlibrary(\"lubridate\")\nlibrary(\"ggplot2\")\n\n#importing the data into a data frame.\n\nheartrate_sec <- read_csv(\"heartrate_seconds_merged.csv\")\n\n#filter and sort the table\n\nheartrate_sec_filterd_and_sorted <- heartrate_sec %>% group_by() %>% arrange(heartrate_sec$Id, heartrate_sec$Time)\n\nView(heartrate_sec_filterd_and_sorted)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### **Data Limitations:**\n* As mentioned before, there is a potential bias, and the number of users is weakly representing the whole population.\n* In the metadata, it's mentioned that the total number is 30 users, however, I can find more than 30 users in some tables which has no official explanation. \n* In some tables, the number of users is too low and not acceptable to be used as a sample.\n* Data is collected through just 2 months which is a small-time period to fully understand users' activity through different seasons.\n* the data from Fitbit is collected from a company targeting Males and Females. But our company is targeting only women. ","metadata":{}},{"cell_type":"markdown","source":"### **More Diving**\nTo understand the whole picture, I made extra research on our products and FitBit products. We almost have the same products, but Fitbit has more like: \n* Jacket trackers \n* Smart scales \n\nFitbit's business and goals are very similar except that Bellabeat is targeting just women.\n\n***********************************\n\n","metadata":{}},{"cell_type":"markdown","source":"# **Process Phase**\n","metadata":{}},{"cell_type":"markdown","source":"\n\n### **Tools:**\nMost of my data isn’t really big. For example, the Daily Activity table contains one thousand rows, The sleep table contains four hundred rows, and the weight table contains less than one hundred rows. So I will work in Spreadsheets for these tables. However, I have another table containing more than two million rows, so I will use R to deal with this table which is **Heart Rate per second** table.\n\n### **Ensuring data integrity:**\nTo identify the integrity of the data, I will rely on four aspects which are:\n* Accuracy \n* Completeness\n* Consistency \n* Trust-worthiness\n\nFor accuracy, I am dealing with data collected from users who approved the process of analyzing their data, and most of the data is collected by smart devices and sensors, so I will approve this data as accurate data.\n\nFor Completeness, There are tables I’m working with not having all the 30 users, just a subset of them, however, the attributes of those users are complete and there are no missing values or missing dates, and I didn’t face any errors while importing the data. So, I will work with available data which is complete.\n\nFor Consistency, I’m working alone on this project, so the data I have here is consistent with the data from the source. There are no other versions with other data analysts. So, there are no consistency problems.\n\nFor trustworthiness, I checked the source of the data in the preparation phase, and I approved that the source is a good one and the data from it is trustworthy.\n\n","metadata":{}},{"cell_type":"markdown","source":"### **What steps have I taken to ensure that the data is clean?**\n\n* I checked if there were Null cells in the data using conditional formatting with data in spreadsheets, and I did the same with the data in R studio using functions. \n* I removed duplicates from my dataset in both spreadsheets and R studio.\n* I checked for outliers by \"len\" function, conditional formatting, and \"countif\" function in spreadsheets.\n* I renamed columns in spreadsheets and R studio to have more clear data.\n* I checked the data with charts for any strange observations.\n* I reformatted the types of the columns to make sure each variable is in the proper format.\n\n","metadata":{}},{"cell_type":"code","source":"# clean The data\n\n  # Check data for errors\n    # counting the missing values\n  \n    sum(is.na(heartrate_sec_filterd_and_sorted$Id))\n    sum(is.na(heartrate_sec_filterd_and_sorted$Time))\n    sum(is.na(heartrate_sec_filterd_and_sorted$Value))\n\n    # counting the duplicated values\n\n    sum(duplicated(heartrate_sec_filterd_and_sorted))\n\n  # manipulate data\n\n    # renaming columns\n\n    heartrate_sec_filterd_and_sorted <- heartrate_sec_filterd_and_sorted %>% rename(DateTime = Time , Heart_rate_value =     Value)\n\n    View(heartrate_sec_filterd_and_sorted)\n\n\n\n\n    # separating date/time column\n  \n    heartrate_sec_filterd_and_sorted <- heartrate_sec_filterd_and_sorted %>%  mutate(separate                               (heartrate_sec_filterd_and_sorted, DateTime, into = c   (\"Date\", \"Time\"), sep = ' ', extra = \"merge\"))\n\n  \n    View(heartrate_sec_filterd_and_sorted)\n\n\n  \n  \n    # filtering the data and transforming it into smaller and more useful data set\n  \n    heartrate_sec_filterd_and_sorted <- heartrate_sec_filterd_and_sorted %>% select(Id, Date, Heart_rate_value) %>%          group_by(Id, Date) %>% summarize(Average_heart_rate =   mean(Heart_rate_value))\n  \n    View(heartrate_sec_filterd_and_sorted)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### **How can you verify that your data is clean and ready to analyze?**\n\nAfter finishing the cleaning tasks, I took a step back and looked at the bigger picture. I compared the raw data and the cleaned data, and I verified the steps I took to clean the data. I made sure to go back to my checklist and see if I did all the required tasks to clean data. I checked if data is still aligned with business tasks and project goals. So, This data is ready to be analyzed.","metadata":{}},{"cell_type":"markdown","source":"### **Change Log**\n\nI made a changelog for each spreadsheet and R studio, anyone with the raw data can follow along with the changes I did and he or she will get the same resulting datasets.\n\nThe link to Spreadsheets changelog: [Here](https://docs.google.com/spreadsheets/d/1ixV0OSz65em7ZMPCukIUg07gMqOAFK5B4n63fcfa54I/edit?usp=sharing)\n\nThe link to my code in R studio changelog: [Here](https://docs.google.com/document/d/1Xk6ZUmqNcgnHc6D6UFfKN_k11w0gW_8X9Ya_zt3W0Wc/edit?usp=sharing)\n\n********************************\n","metadata":{}},{"cell_type":"markdown","source":"# **Analyze Phase**","metadata":{}},{"cell_type":"markdown","source":"**In this phase, I've aggregated my data to make more sense and searched for trends or patterns, and I checked the relationships between variables to find insights that answer my business task.**\n\nFirst, working with my data using Google sheet, I made pivot tables to see data from another angle, and I used quick charts to understand and see relationships.\n\n![image.png](attachment:a9edbdb1-0424-4663-97fd-6955418539e7.png)\n","metadata":{},"attachments":{"a9edbdb1-0424-4663-97fd-6955418539e7.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **Minutes of acitvity and Activity mode**\n\nBy checking the **Activity** table, we can see What types of activity form the activity of the week.\n\n![image.png](attachment:3c4cfdd9-bcf8-44a8-9f32-45a23b8e6633.png)\n","metadata":{},"attachments":{"3c4cfdd9-bcf8-44a8-9f32-45a23b8e6633.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **The relationship between steps and calories**\n\n![image.png](attachment:e81add6d-a066-49f9-9851-98e4488d2131.png)\n\n**By calculating the correlation coffecient, there is a moderate positive correlation between number of steps and calories burnt. **Not just the number of steps but also the type of activity. So, by applying the \"correl()\" function, we can see the correlation strength according to the type of activity.****\n\n![image.png](attachment:c357f0fd-9fa0-42e3-8d65-0e9c73a80147.png)\n\n\n\n","metadata":{},"attachments":{"e81add6d-a066-49f9-9851-98e4488d2131.png":{"image/png":""},"c357f0fd-9fa0-42e3-8d65-0e9c73a80147.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **Days of the week, steps, and actitvity**","metadata":{}},{"cell_type":"markdown","source":"**Using pivot table and inserting some column charts, we can see those results:**\n\n![image.png](attachment:6f50fb6e-82db-4c4b-b742-ffeb8a193523.png)\n\n","metadata":{},"attachments":{"6f50fb6e-82db-4c4b-b742-ffeb8a193523.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **Sleep**\n\nWorking on **sleep_day** table, I've tried to see if there is a pattern in sleep hours and season, but the available data doesn't contain enouph data to confirm or deny a pattern. However I've noticed that the total sleep hours and total hours in bed are **going down** by **May**.\n\n![image.png](attachment:f3646e02-8535-4066-97e7-496f5d82ecab.png)\n","metadata":{},"attachments":{"f3646e02-8535-4066-97e7-496f5d82ecab.png":{"image/png":""}}},{"cell_type":"markdown","source":"**Applying some summary statistics**\n\n![image.png](attachment:ed2c885b-fb0a-4923-9550-ca90f1411437.png)","metadata":{},"attachments":{"ed2c885b-fb0a-4923-9550-ca90f1411437.png":{"image/png":""}}},{"cell_type":"markdown","source":"**Checking if there any patterns with week days.**\n\n![image.png](attachment:d5611fb1-c6ec-46f4-a987-a45681b09dbd.png)","metadata":{},"attachments":{"d5611fb1-c6ec-46f4-a987-a45681b09dbd.png":{"image/png":""}}},{"cell_type":"markdown","source":"**I've decided not use the weight table any more because most of the logs are enterd by just two users. It's not enough to take any resutls from it.**\n\n![image.png](attachment:88f3c5c3-9c5f-4bd4-912a-4cef616ee45e.png)\n","metadata":{},"attachments":{"88f3c5c3-9c5f-4bd4-912a-4cef616ee45e.png":{"image/png":""}}},{"cell_type":"markdown","source":"### **Heart rate**\n\n**Discovering my data table in R**","metadata":{}},{"cell_type":"code","source":"head(heartrate_sec_filterd_and_sorted)\n\nstr(heartrate_sec_filterd_and_sorted)\n\nglimpse(heartrate_sec_filterd_and_sorted)\n    ","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![image.png](attachment:9fe70dca-c22d-4c47-bf01-cca4dc70eb76.png)","metadata":{},"attachments":{"9fe70dca-c22d-4c47-bf01-cca4dc70eb76.png":{"image/png":""}}},{"cell_type":"markdown","source":"![image.png](attachment:c7080adf-b3e9-4d67-975a-74c757d38355.png)","metadata":{},"attachments":{"c7080adf-b3e9-4d67-975a-74c757d38355.png":{"image/png":""}}},{"cell_type":"markdown","source":"![image.png](attachment:df28928b-95a9-47d6-b9b8-9e7bca55e597.png)","metadata":{},"attachments":{"df28928b-95a9-47d6-b9b8-9e7bca55e597.png":{"image/png":""}}},{"cell_type":"code","source":"# Using summary function to get a quick summary statistics.\nheartrate_sec_filterd_and_sorted  %>%  summary()\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![image.png](attachment:7a379d40-c9b2-4cc4-998a-83266d24592e.png)","metadata":{},"attachments":{"7a379d40-c9b2-4cc4-998a-83266d24592e.png":{"image/png":""}}},{"cell_type":"code","source":"# using ggplot2 to construct a histogram\n ggplot(data = heartrate_sec_filterd_and_sorted) +\n    geom_histogram(mapping = aes(x = Average_heart_rate, fill = \"red\", col = \"blue\", alpha = 0.2)) + labs(title=\"Histogram of average heart rates of users\", x =\"average heartrate\", y= \"count\") \n    \n    \n    \n    \n    ","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![image.png](attachment:f6a8181f-bb5f-4a94-bd08-dd992fd6749a.png)\n\n******************************************\n","metadata":{},"attachments":{"f6a8181f-bb5f-4a94-bd08-dd992fd6749a.png":{"image/png":""}}},{"cell_type":"markdown","source":"# **Share Phase**\n","metadata":{}},{"cell_type":"markdown","source":"## **Warnning, you spend a lot of time in sedentary mode**\n\n![Project_bellabeat_BarChart_2022-02-26.png](attachment:238b76fc-64a4-467d-ac41-a68df8e06b4d.png)\n\n### We can use this data to do **two things**:\n\n\n**-We can notify users that they spent a lot of time in sedentary mode. We can notify them through their accessories (our products) or on their devices (our app). That will help to keep our users more active and more interactive with our app.**\n\n\n**-We can use this data in our marketing plan. A survey by Phyzer shows that found that 87% of Americans have at least one fear when they think about getting old. A decline in physical ability is the most feared by 23% of Americans, followed by memory loss at 15% and having a chronic disease or running out of money at 12% each – all of which are higher than the fear of dying at 10% [Read more](https://www.pfizer.com/news/press-release/press-release-detail/fogo_new_survey_reveals_87_of_americans_have_a_fear_of_getting_old_fogo_results_show_top_fear_is_decline_in_physical_ability1#).\n So by science-based articles and studies, we can show our users and potential users that our product can provide them with a service that will make them have a healthy lifestyle and a slow aging process.**\n\n","metadata":{},"attachments":{"238b76fc-64a4-467d-ac41-a68df8e06b4d.png":{"image/png":""}}},{"cell_type":"markdown","source":"## **Sleep better with Bellabeat**\n\n![Sheet 1 (1).png](attachment:1acb4a75-097e-442b-af7d-4a93f00cb183.png)\n\n**By analyzing Sleep data, we find that we need more data to validate any findings. But working with the available data we can find that by the end of the reccorded period which is 12 may, we can find that the sleeping hours and the hours in bed reaches their lowest point, that might mean those variables are changing by the season.\nSo, we can devolope products that help users to sleep better in general like:** \n* **Certain types of fabrics.** \n* **relaxation sessions provided by our application.**\n\n\n\n\n","metadata":{},"attachments":{"1acb4a75-097e-442b-af7d-4a93f00cb183.png":{"image/png":""}}}]}